import React, { Component } from 'react';


class Footer extends Component {


    render() { 
        var footerStyle = {
            //position: 'absolute',
            width: '100%',
            textAlign: 'center',
            justifyContent: 'center',
            height: '10rem',
            marginBottom: '0',  
            //marginTop: '20rem'       
        }

        return (
        <div className="container" style={footerStyle}>
            <p>footer</p>
        </div>
            );
    }
}
 
export default Footer;
